var tipuesearch = {"pages": [{'title': 'About', 'text': '個人網站: \n https://41123115.github.io/cad2023 \n https://s1511.cycu.org/~cad41123115/cad2023 \n 小組網站: \n https://41123112.github.io/cad2023_ag4/content/index.html \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Brython', 'text': 'https://en.wikipedia.org/wiki/Python_(programming_language) \n Examples: \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python Tutorial: \n https://docs.python.org/3/tutorial/ \n An informal introduction to Python \n Indentation (Python 採 4 個 Spaces 縮排, 以界定執行範圍) \n Variables ( Python Keywords ) \n Comments (# 單行註解, 三個單引號或三個雙引號標註多行註解) \n Numbers  (整數 int(), 浮點數 float()) \n Strings  (字串) \n print (Python 內建函式,  print()  函式) \n Python control flow tools \n for \n if \n range \n open \n read \n lists \n tuples \n dictionaries \n functions \n try ... except \n break \n pass \n classes \n 這個頁面 demo 如何在同一頁面下納入多個線上 Ace 編輯器與執行按鈕 ( practice_html.txt  動態頁面超文件). \n practice_html.txt  動態頁面超文件應該可以在啟動 Brython 時, 設定將 .py 檔案放入 downloads/py 目錄中引用. \n 亦即將所有對應的 html 也使用 Brython 產生, 然後寫為  class  後, 在範例導入時透過  instance  引用. \n <!-- 啟動 Brython -->\n<script>\nwindow.onload=function(){\nbrython({debug:1, pythonpath:[\'./../cmsimde/static/\',\'./../downloads/py/\']});\n}\n</script> \n 從 1 累加到 100: \n 1 add to 100 \n 將 iterable 與 iterator  相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n \n \n \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n', 'tags': '', 'url': 'Brython.html'}, {'title': 'W12', 'text': '', 'tags': '', 'url': 'W12.html'}, {'title': '網路設定', 'text': '以 管理者身分 執行cad2023_network_setup批次檔案, 關閉 IPv4 網路協定,並開啟IPv6 網路. \n 1_disable_ipv4.ps1:只啟動 IPv6 網路協定. \n # 關閉 IPv4 網路 \n Disable-NetAdapterBinding -Name  "*"   -ComponentID ms_tcpip \n # 啟用 IPv6 網路 Enable-NetAdapterBinding -Name "*" -ComponentID ms_tcpip6 \n', 'tags': '', 'url': '網路設定.html'}, {'title': '專案一零組件繪圖', 'text': '', 'tags': '', 'url': '專案一零組件繪圖.html'}, {'title': '繪圖檔案', 'text': '小組製圖檔案 \n 全部檔案下載位置 \n \n', 'tags': '', 'url': '繪圖檔案.html'}, {'title': '模擬影片', 'text': '感測器位於軌道底端 \n \n \n 下載模組 pip install cbor pyzmq \n \n 下載模組 \n \n 遇到的問題:(已解決) \n 1.無法使用pip下載模組.  \n \xa0 \xa0解決方法:到編輯系統環境變數的PYTH新增python路徑,以及scripts資料夾中的pip. \n ----------------------------------------------------------------------------------------------------------- \n 2.系統抓不到檔案位置.  \n \xa0 \xa0解決方法:我是把下載模組的cmd開著並且檔案都要放在同一個目錄. \n ----------------------------------------------------------------------------------------------------------- \n 3.影片檔太大導致無法推回github使用git reset --hard HEAD^(回到上一個版本).', 'tags': '', 'url': '模擬影片.html'}, {'title': 'HW', 'text': '', 'tags': '', 'url': 'HW.html'}, {'title': 'Replit', 'text': '1.進入與github倉儲連線的網站,按RUN執行網站開啟. \n \n 2.進入網站 \n \n 3.更新完東西,轉成靜態網站 \n \n 4.到repit,git-->push \n \n 5.到github倉儲確認更新 \n \n', 'tags': '', 'url': 'Replit.html'}, {'title': 's1511', 'text': '開啟/更新網站步驟: \n 1.使用隨身碟中的ssh批次檔,來自架 s1511.cycu.org網站+埠號 \n 2.cd(切換目錄)cad2023,打python3 server.py來開啟自架的網站,其中server.py中的埠號要改成自己的. \n 3.到google輸入https://s1511.cycu.org:(埠號). \n 4.如要更新網站,convert轉成靜態,用acp打訊息等待github轉換更新網站. \n \n', 'tags': '', 'url': 's1511.html'}, {'title': 'localhost', 'text': 'localhost 透過 token, SSH 確定 git push 權限, SSH 設定可透過 Putty 完成 \n', 'tags': '', 'url': 'localhost.html'}, {'title': 'w15雙U', 'text': '', 'tags': '', 'url': 'w15雙U.html'}, {'title': '繪圖過程及檔案', 'text': '平面雙U鋼球軌道檔案 \n \n \n', 'tags': '', 'url': '繪圖過程及檔案.html'}, {'title': '模擬影片-2', 'text': '1.sensor(感測器)與marble(球體)要跟coppliasim名稱一致! \n 2.感測器在 coppliasim裡要開啟不然程式方面偵測不到. \n \n \n \n', 'tags': '', 'url': '模擬影片-2.html'}, {'title': '繪圖軟體', 'text': '', 'tags': '', 'url': '繪圖軟體.html'}, {'title': 'solidwork', 'text': ' Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n \n \n \n \n', 'tags': '', 'url': 'solidwork.html'}, {'title': '個人評分', 'text': '', 'tags': '', 'url': '個人評分.html'}, {'title': '自評表', 'text': '自評分數60 \n A: 是否按照進度明確標示倉儲的改版歷程 \n \xa0 \xa0 \xa0答:有更新,但沒完全做完,盡力去做. \n B: 是否根據 \xa0 IPv4 與 IPv6 \xa0 網路環境設定進行作法討論 \n \xa0 \xa0 \xa0 答: 有 \n C: 是否就 \xa0 Replit、s.cycu.org 與 localhost \xa0 情境下對個人與分組倉儲進行設定操作 \n \xa0 \xa0 \xa0 答: 有 \n D: 是否就所分配的 \xa0 CAD 套件 從安裝設定到繪圖提供內容參考 \n \xa0 \xa0 \xa0 答: 有,安裝solidwork,且使用此程式繪圖. \n E: 是否使用所分配的 CAD 套件完成 專案一零組件繪圖 , 並提供零組件下載 \n \xa0 \xa0 \xa0 答: 有 \n F: 是否將自行繪製的專案一零組件 轉入 CoppeliaSim \n \xa0 \xa0 \xa0 答: 是,且有模擬了 \n G: 是否利用 \xa0 ZMQ Remote API Python \xa0 對專案一轉入的零組件設定感測器, 並進行 鋼球永動模擬 \n \xa0 \xa0 \xa0 答: 是 \n H: 是否實際操作 \xa0 Triangle 軌道系統 的鋼球永動模擬 \n \xa0 \xa0 \xa0 答:是 \n I: 是否完成 W15 的平面雙 U 迴路上的 鋼球永動系統繪圖、轉檔與系統模擬 \n \xa0 \xa0 \xa0 答: 是 \n J: 是否使用所分配的 CAD 套件完成 專案二 1D 平台零組件繪圖 , 並提供零組件下載 \n \xa0 \xa0 \xa0 答: 否 \n K: 是否利用 \xa0 ZMQ Remote API Python \xa0 對專案二轉入的零組件設定感測器, 並進行鋼球永動模擬 \n \xa0 \xa0 \xa0 答: 還沒 \n L: 是否針對專案二的 1D 平台鋼球平衡系統所需的 \xa0 PID 控制理論 進行資料收集與 ChatGPT 對答 \n \xa0 \xa0 \xa0 答: 還沒', 'tags': '', 'url': '自評表.html'}, {'title': '斜坡', 'text': '', 'tags': '', 'url': '斜坡.html'}, {'title': '圖檔', 'text': '斜坡圖檔 \n', 'tags': '', 'url': '圖檔.html'}, {'title': '模擬影片-3', 'text': '\n \n 遇到的問題: \n 1.防火牆要關閉,不然會跳 >Process failed to respond; forcing abrupt termination... >Exit code: 1錯誤訊息,也有可能是沒安裝模組或是沒再coppliasim開啟可碰撞. \n 2.因為我是手機網路所以程式localhost要更改ip位置.', 'tags': '', 'url': '模擬影片-3.html'}]};